# Tambovka, Republic of Bashkortostan

}}
Tambovka () is a rural locality (a village) in Polyakovsky Selsoviet, Davlekanovsky District, Bashkortostan, Russia. The population was 17 as of 2010. There is 1 street.
Geography
Tambovka is located 24 km north of Davlekanovo (the district's administrative centre) by road. Gribovka is the nearest rural locality.
